@DominicRaab @Andrew_Adonis My Dad started chemotherapy yesterday, if he can stand it (🤞) he will be having treatment for the next 30 weeks. As well as the chemo he needs steroids &amp; anti emetics.

He is one of many in this / similar situations.

3 months/12 weeks is pathetic. DON’T jeopardise it at all!!!!

